e',0,'${value}'),(53930,47,2705,0,'variable_type',0,'PARENT_JOB'),(53931,47,2706,0,'script',0,'\n// Class type definition.\nvar classType = \"\";\nif (parent_job.getVariable(\"type\").equals(\"subtypeContentNodes\")) {\n  classType = \"documents\";\n}\nelse if (parent_job.getVariable(\"type\").equals(\"subtypeFolderNodes\")) {\n  classType = \"folders\";\n}\nelse if (parent_job.getVariable(\"type\").equals(\"aspects\")) {\n  classType = \"aspects\";\n}\n\n// Table prefix definition depending on the layer type.\nvar tablePrefix = \"\";\nif (parent_job.getVariable(\"layer\").equals(\"operational\")) {\n  tablePrefix = \"ope_rest\";\n}\nelse if (parent_job.getVariable(\"layer\").equals(\"datamart\")) {\n  tablePrefix = \"dm_dim\";\n}\n\n// Custom metadata information.\nvar custom_metadata_info = JSON.parse(\"{\\\"types\\\":[],\\\"aspects\\\":[]}\");\nif (parent_job.getVariable(\"custom_metadata_info\") != null && \n    !parent_job.getVariable(\"custom_metadata_info\").equals(\"\")) {\n  custom_metadata_info = JSON.parse(parent_job.getVariable(\"custom_metadata_info\"));\n}\n\n// Array of classes definition.\nvar classes = [];\nif (custom_metadata_info.types.length) {\n  classes = custom_metadata_info.types;\n} else if (custom_metadata_info.aspects.length) {\n  classes = custom_metadata_info.aspects;\n}\n\n// Init query variable.\nvar query = \"\";\n\nquery += \"select\";\nquery += \" sum(t.value) as value \";\nquery += \"from (\";\nquery += \"select 0 as value\";\n\nfor (var i = 0; i < classes.length; ++i) {\n\n  var class = Object.keys(classes[i])[0].replace(\":\", \"_\").trim()\n\n  var tableName = tablePrefix + \"_\" + classType + \"_\" + class;\n  if (tableName.length > parseInt(parent_job.getVariable(\"table_name_max_length\",\"\"))) {\n    var id = getClassId(class);\n    var postfix = \"_\" + id.trim();\n    tableName = tableName.substr(0, parseInt(parent_job.getVariable(\"table_name_max_length\",\"\")) - postfix.length);\n    tableName += postfix;\n  }\n\n  query += \" \";\n  query += \"union all \";\n  query += \"select\";\n  query += \" count(*) as value \";\n  query += \"from\";\n  query += \" `\" + tableName + \"` \";\n  query += \"where\";\n  query += \" alfresco_id = \" + parent_job.getVariable(\"alfresco_id\");\n\n}\n\nquery += \") t\";\n\nparent_job.setVariable(\"query\",query);\n\n// Result.\nif (parent_job.getVariable(\"layer\").equals(\"operational\") || parent_job.getVariable(\"layer\").equals(\"datamart\")) {\n  true;\n}\nelse {\n  false;\n}\n\n// ========================================\n\nfunction getClassId(className) {\n\n  var metadataInfo = JSON.parse(getVariable(\"custom_classes_ids\",\"\"));\n\n  if (class_type.equals(\"aspects\")) {\n\n    for (var  i = 0; i < metadataInfo.aspects.length; ++i) {\n      for (metadataInfoClassName in metadataInfo.aspects[i]) {\n        if (className.equals(metadataInfoClassName)) {\n          return metadataInfo.aspects[i][metadataInfoClassName];\n        }\n      }\n    }\n\n  }\n  else {\n\n    for (var  i = 0; i < metadataInfo.types.length; ++i) {\n      for (metadataInfoClassName in metadataInfo.types[i]) {\n        if (className.equals(metadataInfoClassName)) {\n          return metadataInfo.types[i][metadataInfoClassName];\n        }\n      }\n    }\n\n  }\n\n  throw \"Class id not defined for \'\" + className + \"\'.\";\n}\n'),(53932,47,2707,0,'specification_method',0,'rep_name'),(53933,47,2707,0,'trans_object_id',0,NULL),(53934,47,2707,0,'name',0,'Get the custom metadata info'),(53935,47,2707,0,'dir_path',0,'/Alfresco/Utility/Custom metadata/Utility'),(53936,47,2707,0,'file_name',0,NULL),(53937,47,2707,0,'arg_from_previous',0,'N'),(53938,47,2707,0,'params_from_previous',0,'N'),(53939,47,2707,0,'exec_per_row',0,'N'),(53940,47,2707,0,'clear_rows',0,'N'),(53941,47,2707,0,'clear_files',0,'N'),(53942,47,2707,0,'set_logfile',0,'N'),(53943,47,2707,0,'add_date',0,'N'),(53944,47,2707,0,'add_time',0,'N'),(53945,47,2707,0,'logfile',0,NULL),(53946,47,2707,0,'logext',0,NULL