 int not null, \";\n  }\n  else if (is_aspect.equals(\'Y\')) {\n    query += \"`document_node-dbid` int null, \";\n    query += \"`folder_node-dbid` int null, \";\n  }\n\n  // Fields.\n  var propertyList = JSON.parse(properties);\n  for (var i=0; i < propertyList.list.length; ++i) {\n\n    var property = propertyList.list[i];\n\n    query += \"`\" + property.name.replace(\":\", \"_\") + \"` \";\n\n    switch(property.type) {\n      case \"d:boolean\":  query += \"boolean\";          break;\n      case \"d:date\":     query += \"date\";             break;\n      case \"d:datetime\": query += \"datetime\";         break;\n      case \"d:double\":   query += \"double precision\"; break;\n      case \"d:float\":    query += \"numeric\";          break;\n      case \"d:int\":      query += \"int\";              break;\n      case \"d:long\":     query += \"bigint\";           break;\n      case \"d:text\":     query += \"varchar(1024)\";    break;\n      default:           query += \"varchar(1024)\";    break;\n    }\n\n    query += \", \";\n  }\n\n  // Primary key.\n  if (is_document_subtype.equals(\'Y\')) {\n    query += \"PRIMARY KEY (`alfresco_id`, `document_node-dbid`), \";\n  }\n  else if (is_folder_subtype.equals(\'Y\')) {\n    query += \"PRIMARY KEY (`alfresco_id`, `folder_node-dbid`), \";\n  }\n  else if (is_aspect.equals(\'Y\')) {\n    query += \"UNIQUE (`alfresco_id`, `document_node-dbid`, `folder_node-dbid`), \";\n  }\n\n  // Foreign keys.\n  query += \"FOREIGN KEY (`alfresco_id`) REFERENCES `dm_dim_alfresco` (`id`) ON UPDATE CASCADE ON DELETE CASCADE \";\n\n  // Ending of the queries.\n  query += \") ENGINE=InnoDB DEFAULT CHARSET=utf8; \";\n\n  return query;\n}\n\nfunction getCreateSqlForDataMart() {\n\n  // Table name defintion.\n  var tableName = \"dm_dim_\";\n  if (is_document_subtype.equals(\'Y\')) {\n    tableName += \"documents\";\n  }\n  else if (is_folder_subtype.equals(\'Y\')) {\n    tableName += \"folders\";\n  }\n  else if (is_aspect.equals(\'Y\')