n table name.\n  var dimTableName = \"dm_dim_\";\n  if (is_document_subtype.equals(\'Y\')) {\n    dimTableName += \"documents\";\n  }\n  else if (is_folder_subtype.equals(\'Y\')) {\n    dimTableName += \"folders\";\n  }\n  else if (is_aspect.equals(\'Y\')) {\n    dimTableName += \"aspects\";\n  }\n  dimTableName += \"_\" + class.replace(\":\", \"_\").trim();\n  if (dimTableName.length > parseInt(getVariable(\"table_name_max_length\",\"\"))) {\n    var postfix = \"_\" + id.trim();\n    dimTableName = dimTableName.substr(0, parseInt(getVariable(\"table_tame_max_length\",\"\")) - postfix.length);\n    dimTableName += postfix;\n  }\n\n  var query = \"\";\n\n  if (is_document_subtype.equals(\'Y\') || is_aspect.equals(\'Y\')) {\n\n    // Delete command.\n    query += \"DELETE FROM `\" + dimTableName + \"` \";\n    query += \"WHERE \";\n    query += \"alfresco_id = \" + getVariable(\"alfresco_id\",\"\") + \" \";\n    query += \"AND src_id IN (SELECT `document_node-dbid` FROM `\" + opeTableName + \"` WHERE alfresco_id = \" + getVariable(\"alfresco_id\",\"\") + \")\";\n    query += \"; \";\n\n  }\n\n  if (is_folder_subtype.equals(\'Y\') || is_aspect.equals(\'Y\')) {\n\n    // Delete command.\n    query += \"DELETE FROM `\" + dimTableName + \"` \";\n    query += \"WHERE \";\n    query += \"alfresco_id = \" + getVariable(\"alfresco_id\",\"\") + \" \";\n    query += \"AND src_id IN (SELECT `folder_node-dbid` FROM `\" + opeTableName + \"` WHERE alfresco_id = \" + getVariable(\"alfresco_id\",\"\") + \")\";\n    query += \"; \";\n\n  }\n\n  return query;\n}\n'),(21363,59,1124,0,'jsScript_type',0,NULL),(21364,59,1124,0,'field_name',0,'query'),(21365,59,1124,0,'field_rename',0,'query'),(21366,59,1124,0,'field_type',0,'String'),(21367,59,1124,0,'field_length',-1,NULL),(21368,59,1124,0,'field_precision',-1,NULL),(21369,59,1124,0,'field_replace',0,'N'),(21370,59,1124,0,'cluster_schema',0,NULL),(21371,59,1124,0,'row_distribution_code',0,NULL),(22566,30,1164,0,'PARTITIONING_SCHEMA',0,NUL