ename',0,'duration'),(25692,41,1307,11,'value_update',0,'Y'),(25693,41,1307,12,'value_name',0,'max_duration'),(25694,41,1307,12,'value_rename',0,'max_duration'),(25695,41,1307,12,'value_update',0,'Y'),(25696,41,1307,13,'value_name',0,'diagram_url'),(25697,41,1307,13,'value_rename',0,'diagram_url'),(25698,41,1307,13,'value_update',0,'Y'),(25699,41,1307,14,'value_name',0,'definition_id'),(25700,41,1307,14,'value_rename',0,'definition_id'),(25701,41,1307,14,'value_update',0,'Y'),(25702,41,1307,15,'value_name',0,'alfresco_id'),(25703,41,1307,15,'value_rename',0,'alfresco_id'),(25704,41,1307,15,'value_update',0,'N'),(25705,41,1307,16,'value_name',0,'src_id'),(25706,41,1307,16,'value_rename',0,'src_id'),(25707,41,1307,16,'value_update',0,'N'),(25708,41,1307,0,'cluster_schema',0,NULL),(25709,41,1307,0,'row_distribution_code',0,NULL),(25710,41,1308,0,'PARTITIONING_SCHEMA',0,NULL),(25711,41,1308,0,'PARTITIONING_METHOD',0,'none'),(25712,41,1308,0,'id_connection',1,NULL),(25713,41,1308,0,'sql',0,'select\n ${alfresco_id} as alfresco_id,\n \'Unknown\' as src_id,\n \'Unknown\' as `name`,\n \'Unknown\' as title,\n \'Unknown\' as `desc`,\n (select u2.id from dm_dim_users u2 where u2.alfresco_id = ${alfresco_id} and u2.src_user = \'UNKNOWN\') as initiator_id,\n \'UNKNOWN\' as is_active,\n str_to_date(\'2000-01-01\',\'%Y-%m-%d\') as start_date_id,\n -1 as start_minute_id,\n str_to_date(\'2000-01-01\',\'%Y-%m-%d\') as due_date_id,\n -1 as due_minute_id,\n str_to_date(\'2000-01-01\',\'%Y-%m-%d\') as end_date_id,\n -1 as end_minute_id,\n 0 as duration,\n 0 as max_duration,\n \'Unknown\' as diagram_url,\n (select w2.id from dm_dim_workflow_definitions w2 where w2.alfresco_id = ${alfresco_id} and w2.url = \'Unknown\') as definition_id\nunion all\nselect\n ${alfresco_id} as alfresco_id,\n stg_workflow_instances.id as src_id,\n stg_workflow_instances.name as `name`,\n stg_workflow_instances.title as title,\n stg_workflow_instances.description as `desc`,\n coalesce(dm_dim_users.id, (select u2.id from dm_dim_users u2 where u2.alfresco_id = ${alfresco_id} and u2.src_user = \'UNKNOWN\')) as initiator_id,\n upper(stg_workflow_instances.isactive) as is_active,\n coalesce(date(stg_workflow_instances.startdate), str_to_date(\'2000-01-01\',\'%Y-%m-%d\')) as start_date_id,\n coalesce((extract(hour from stg_workflow_instances.startdate) * 60) + extract(minute from stg_workflow_instances.startdate),-1) as start_minute_id,\n coalesce(date(stg_workflow_instances.duedate), str_to_date(\'2000-01-01\',\'%Y-%m-%d\')) as due_date_id,\n coalesce((extract(hour from stg_workflow_instances.duedate) * 60) + extract(minute from stg_workflow_instances.duedate),-1) as due_minute_id,\n coalesce(date(stg_workflow_instances.enddate), str_to_date(\'2000-01-01\',\'%Y-%m-%d\')) as end_date_id,\n coalesce((extract(hour from stg_workflow_instances.enddate) * 60) + extract(minute from stg_workflow_instances.enddate),-1) as end_minute_id,\n round(coalesce(timediff(str_to_date(stg_workflow_instances.enddate,\'%Y-%m-%dT%H:%i:%s\'),str_to_date(stg_workflow_instances.startdate,\'%Y-%m-%dT%H:%i:%s\'))/60,0)) as duration,\n round(coalesce(timediff(str_to_date(stg_workflow_instances.duedate,\'%Y-%m-%dT%H:%i:%s\'),str_to_date(stg_workflow_instances.startdate,\'%Y-%m-%dT%H:%i:%s\'))/60,0)) as max_duration,\n case when stg_workflow_instances.enddate is null then concat(dm_dim_alfresco.url,\'/alfresco/service/api/workflow-instances/\',stg_workflow_instances.id,\'/diagram\') else \'Unknown\' end as diagram_url,\n coalesce(dm_dim_workflow_definitions.id, (select w2.id from dm_dim_workflow_definitions w2 where w2.alfresco_id = ${alfresco_id} and w2.url = \'Unknown\')) as definition_id\nfrom\n stg_workflow_instances\n join dm_dim_alfresco on stg_workflow_instances.alfresco_id = dm_dim_alfresco.id\n left join dm_dim_users on dm_dim_users.alfresco_id = dm_dim_alfresco.id and dm_dim_users.src_user = upper(stg_workflow_instances.initiator)\n left join dm_dim_workflow_definitions on dm_dim_workflow_definitions.alfresco_id = dm_dim_alfresco.id and dm_dim_workflow_definitions.url = stg_workflow_instances.definitionurl\nwhere\n stg_workflow_instances.alfresco_id = ${alfresco_id}\n\n'),(25714,41,1308,0,'limit',0,'0'),(25715,41,1308,0,'lookup',0,NULL),(25716,41,1308,0,'execute_each_row',0,'N'),(25717,41,1308,0,'variables_active',0,'Y'),(25718,41,1308,0,'lazy_conversion_active',0,'N'),(25719,41,1308,0,'cluster_schema',0,NULL),(25720,41,1308,0,'row_distribution_code',0,NULL),(25721,41,1309,0,'PARTITIONING_SCHEMA',0,NULL),(25722,41,1309,0,'PARTITIONING_METHOD',0,'none'),(25723,41,1309,0,'id_connection',1,NULL),(25724,41,1309,0,'sql',0,'select \n dm_dim_workflow_instances.alfresco_id as alfresco_id,\n dm_dim_workflow_instances.id as id\nfrom\n dm_dim_workflow_instances\nwhere\n dm_dim_workflow_instances.alfresco_id = ${alfresco_id}\n and dm_dim_workflow_instances.is_active = \'TRUE\'\n and dm_dim_workflow_instances.src_id not in (\n  select stg_workflow_instances.id\n  from stg_workflow_instances\n  where stg_workflow_instances.alfresco_id = ${alfresco_id}\n )'),(25725,41,1309,0,'limit',0,'0'),(25726,41,1309,0,'lookup',0,NULL),(25727,41,1309,0,'execute_each_row',0,'N'),(25728,41,1309,0,'variables_active',0,'Y'),(25729,41,1309,0,'lazy_conversion_active',0,'N'),(25730,41,1309,0,'cluster_schema',0,NULL),(25731,41,1309,0,'row_distribution_code',0,NULL),(25732,41,1310,0,'PARTITIONING_SCHEMA',0,NULL),(25733,41,1310,0,'PARTITIONING_METHOD',0,'none'),(25734,41,1310,0,'id_connection',1,NULL),(25735,41,1310,0,'commit',0,'1000'),(25736,41,1310,0,'schema',0,NULL),(25737,41,1310,0,'table',0,'dm_dim_folders'),(25738,41,1310,0,'update_bypassed',0,'N'),(25739,41,1310,0,'key_name',0,'alfresco_id'),(25740,41,1310,0,'key_field',0,'alfresco_id'),(25741,41,1310,0,'key_condition',0,'='),(25742,41,1310,0,'key_name2',0,NULL),(25743,41,1310,1,'key_name',0,'src_id'),(25744,41,1310,1,'key_field',0,'src_id'),(25745,41,1310,1,'key_condition',0,'='),(25746,41,1310,1,'key_name2',0,NULL),(25747,41,1310,0,'va