id and dm_dim_workflow_instances.src_id = stg_workflow_tasks.instance_id\nwhere\n stg_workflow_tasks.alfresco_id = ${alfresco_id}'),(27764,42,1409,0,'limit',0,'0'),(27765,42,1409,0,'lookup',0,NULL),(27766,42,1409,0,'execute_each_row',0,'N'),(27767,42,1409,0,'variables_active',0,'Y'),(27768,42,1409,0,'lazy_conversion_active',0,'N'),(27769,42,1409,0,'cluster_schema',0,NULL),(27770,42,1409,0,'row_distribution_code',0,NULL),(27771,53,1410,0,'PARTITIONING_SCHEMA',0,NULL),(27772,53,1410,0,'PARTITIONING_METHOD',0,'none'),(27773,53,1410,0,'id_connection',1,NULL),(27774,53,1410,0,'sql',0,'SELECT\n \"aspects\" AS class_type,\n alfresco_id AS alfresco_id,\n `node-dbid` as document_node_dbid,\n null as folder_node_dbid,\n custom_aspects AS custom_metadata\nFROM\n stg_rest_documents\nWHERE\n alfresco_id = ${alfresco_id}\n AND custom_aspects is not null\nUNION ALL\nSELECT\n \"aspects\" AS class_type,\n alfresco_id AS alfresco_id,\n null as document_node_dbid,\n `node-dbid` as folder_node_dbid,\n custom_aspects AS custom_metadata\nFROM\n stg_rest_folders\nWHERE\n alfresco_id = ${alfresco_id}\n AND custom_aspects is not null\nUNION ALL\nSELECT\n \"documents\" AS class_type,\n alfresco_id AS alfresco_id,\n `node-dbid` as document_node_dbid,\n null as folder_node_dbid,\n custom_types AS custom_metadata\nFROM\n stg_rest_documents_custom_types\nWHERE\n alfresco_id = ${alfresco_id}\n AND custom_types is not null\nUNION ALL\nSELECT\n \"folders\" AS class_type,\n alfresco_id AS alfresco_id,\n null as document_node_dbid,\n `node-dbid` as folder_node_dbid,\n custom_types AS custom_metadata\nFROM\n stg_rest_folders_custom_types\nWHERE\n alfresco_id = ${alfresco_id}\n AND custom_types is not null'),(27775,53,1410,0,'limit',0,'0'),(27776,53,1410,0,'lookup',0,NULL),(27777,53,1410,0,'execute_each_row',0,'N'),(27778,53,1410,0,'variables_active',0,'Y'),(27779,53,1410,0,'lazy_conversion_active',0,'N'),(27780,53,1410,0,'cluster_schema',0,NULL),(27781,53,1410,0,'row_distribution_code',0,NULL),(27782,