.equals(\'Y\')) {\n    opeTableName += \"aspects\";\n  }\n  opeTableName += \"_\" + class.replace(\":\", \"_\").trim();\n  if (opeTableName.length > parseInt(getVariable(\"table_name_max_length\",\"\"))) {\n    var postfix = \"_\" + id.trim();\n    opeTableName = opeTableName.substr(0, parseInt(getVariable(\"table_tame_max_length\",\"\")) - postfix.length);\n    opeTableName += postfix;\n  }\n\n  // Dimension table name.\n  var dimTableName = \"dm_dim_\";\n  if (is_document_subtype.equals(\'Y\')) {\n    dimTableName += \"documents\";\n  }\n  else if (is_folder_subtype.equals(\'Y\')) {\n    dimTableName += \"folders\";\n  }\n  else if (is_aspect.equals(\'Y\')) {\n    dimTableName += \"aspects\";\n  }\n  dimTableName += \"_\" + class.replace(\":\", \"_\").trim();\n  if (dimTableName.length > parseInt(getVariable(\"table_name_max_length\",\"\"))) {\n    var postfix = \"_\" + id.trim();\n    dimTableName = dimTableName.substr(0, parseInt(getVariable(\"table_name_max_length\",\"\")) - postfix.length);\n    dimTableName += postfix;\n  }\n\n  var fieldsJson = JSON.parse(fields);\n  var properties = fieldsJson.properties;\n\n  var query = \"\";\n\n  if (is_document_subtype.equals(\'Y\') || is_aspect.equals(\'Y\')) {\n\n    // Update command.\n    query += \"UPDATE \";\n    query += \"`\" + dimTableName + \"` AS c \";\n    query += \"JOIN `dm_dim_documents` AS d ON c.alfresco_id = d.alfresco_id AND c.document_id = d.id \";\n    query += \"JOIN `\" + opeTableName + \"` AS o ON o.alfresco_id = d.alfresco_id AND o.`document_node-dbid` = d.src_id \";\n\n    query += \"SET \";\n	for (var i in properties) {\n      query += \"c.`\" + properties[i].replace(\":\", \"_\").trim() + \"` = o.`\" + properties[i].replace(\":\", \"_\").trim() + \"`, \";\n    }\n    query = query.substring(0,query.length-2);\n    query += \" \";\n\n    query += \"WHERE \";\n    query += \" o.alfresco_id = \" + getVariable(\"alfresco_id\",\"\");\n    query += \"; \";\n\n    // Insert command.\n    query += \"INSERT INTO `\" + dimTableName + \"` (\";\n\n    // Field list.\n    query += \"document_id,\";\n    if (is_aspect.equals(\'Y\')) {\n      query += \"folder_id,\";\n    }\n    query += \"prog,\";\n\n	for (i in properties) {\n      query += \"`\" + properties[i].replace(\":\", \"_\").trim() + \"`,\";\n    }\n\n    query += \"alfresco_id,\";\n    query += \"src_id\";\n\n    query += \") \";\n\n    // Select command.\n    query += \"SELECT\";\n    query += \" d.id AS document_id,\";\n    if (is_aspect.equals(\'Y\')) {\n      query += \" null AS folder_id,\";\n    }\n    query += \" 1 AS prog,\";\n\n	for (i in properties) {\n      query += \" o.`\" + properties[i].replace(\":\", \"_\").trim() + \"`,\";\n    }\n\n    query += \" o.alfresco_id AS alfresco_id,\";\n    query += \" o.`document_node-dbid` AS src_id \";\n\n    query += \"FROM `\" + opeTableName + \"` AS o\";\n    query += \" JOIN `dm_dim_documents` AS d ON d.alfresco_id = o.alfresco_id AND d.src_id = o.`document_node-dbid` \";\n    query += \" LEFT JOIN `\" + dimTableName + \"` AS c ON c.alfresco_id = d.alfresco_id AND c.document_id = d.id \";\n    query += \"WHERE \";\n    query += \" o.alfresco_id = \" + getVariable(\"alfresco_id\",\"\");\n    query += \" AND c.document_id IS NULL\";\n    query += \"; \";\n\n  }\n\n  if (is_folder_subtype.equals(\'Y\') || is_aspect.equals(\'Y\')) {\n\n    // Update command.\n    query += \"UPDATE \";\n    query += \"`\" + dimTableName + \"` AS c \";\n    query += \"JOIN `dm_dim_folders` AS d ON c.alfresco_id = d.alfresco_id AND c.folder_id = d.id \";\n    query += \"JOIN `\" + opeTableName + \"` AS o ON o.alfresco_id = d.alfresco_id AND o.`folder_node-dbid` = d.src_id \";\n\n    query += \"SET \";\n	for (var i in properties) {\n      query += \"c.`\" + properties[i].replace(\":\", \"_\").trim() + \"` = o.`\" + properties[i].replace(\":\", \"_\").trim() + \"`, \";\n    }\n    query = query.substring(0,query.length-2);\n    query += \" \";\n\n    query += \"WHERE \";\n    query += \" o.alfresco_id = \" + getVariable(\"alfresco_id\",\"\");\n    query += \"; \";\n\n    // Insert command.\n    query += \"INSERT INTO `\" + dimTableName + \"` (\";\n\n    // Field list.\n    if (is_aspect.equals(\'Y\')) {\n      query += \"document_id,\";\n    }\n    query += \"folder_id,\";\n    query += \"prog,\";\n\n	for (i in properties) {\n      query += \"`\" + properties[i].replace(\":\", \"_\").trim() + \"`,\";\n    }\n\n    query += \"alfresco_id,\";\n    query += \"src_id\";\n\n    query += \") \";\n\n    // Select command.\n    query += \"SELECT\";\n    if (is_aspect.equals(\'Y\')) {\n      query += \" null AS document_id,\";\n    }\n    query += \" f.id AS folder_id,\";\n    query += \" 1 AS prog,\";\n\n	for (i in properties) {\n      query += \" o.`\" + properties[i].replace(\":\", \"_\").trim() + \"`,\";\n    }\n\n    query += \" o.alfresco_id AS alfresco_id,\";\n    query += \" o.`folder_node-dbid` AS src_id \";\n\n    query += \"FROM `\" + opeTableName + \"` AS o\";\n    query += \" JOIN `dm_dim_folders` AS f ON f.alfresco_id = o.alfresco_id AND f.src_id = o.`folder_node-dbid`\";\n    query += \" LEFT JOIN `\" + dimTableName + \"` AS c ON c.alfresco_id = f.alfresco_id AND c.folder_id = f.id \";\n    query += \"WHERE \";\n    query += \" o.alfresco_id = \" + getVariable(\"alfresco_id\",\"\");\n    query += \" AND c.folder_id IS NULL\";\n    query += \"; \";\n\n  }\n\n  return query;\n}\n'),(27858,55,1416,0,'jsScript_type',0,NULL),(27859,55,1416,0,'field_name',0,'query'),(27860,55,1416,0,'field_rename',0,'query'),(27861,55,1416,0,'field_type',0,'String'),(27862,55,1416,0,'field_length',-1,NULL),(27863,55,1416,0,'field_precision',-1,NULL),(27864,55,1416,0,'field_replace',0,'N'),(27865,55,1416,0,'cluster_schema',0,NULL),(27866,55,1416,0,'row_distribution_code',0,NULL);

